import './HeadBar.css';
import elipPic from '../img/Ellipse103.png';
import { Col, Row, Container, Nav, Button} from "react-bootstrap";
import { LoremIpsum } from 'react-lorem-ipsum';
// import { faPlaycircle } from "@fortawesome/free-regular-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPlayCircle } from '@fortawesome/free-regular-svg-icons'



function Elip() {
  return (
    <Container className="container" fluid>
    <Row>
      <Col sm={5} className="logoBrand">
        <img src={elipPic} alt="logo"></img>
        
      </Col>
      <Col sm={7} >
        <h3>Gesundhelit ganzheittlich betrachten</h3>
        <h4>Dr. med. Hans-Joachim Petershon</h4>
        <LoremIpsum></LoremIpsum>
      </Col>
    </Row>

  </Container>    
          
  );
}

export default Elip;
